//creating navbar component
function Navbar(){
    return(
        <nav>
            <h1>Perfumy</h1>
            <ul>
                <li>Home |</li>
                <li>Product |</li>
                <li>Contact |</li>
                <li>About us |</li>
            </ul>
        </nav>
    )
}
export default Navbar
